import React, { useState , useEffect } from 'react'
import './App.css'

function App() {
  const [open , setOpen] = useState('close')

  function handleClick(){
    console.log(open)
    if(open==='open'){
      setOpen('close')
    }
    setOpen('open')
  }



  return (
    <div onClick={handleClick}>
      <img src={`./images/${open}.png`} alt='folder'/>
    </div>
  );
}

export default App;
